import { Route, Routes } from "react-router-dom";
import Main from "./Main";
import "./styels.css";
import DisplayButton from "./components/Task1/DisplayButton"
function App() {
  return (
    <div>
      <Routes>
        <Route element={<Main />} path="/">
        <Route

              Component={<DisplayButton/>}
              path=""
            ></Route>
        </Route>
      </Routes>
    </div>
  );
}

export default App;
